window.bookSummaryJSON = "<p><b><i>New York Times</i> bestselling author Robert Dugoni's acclaimed series continues as Tracy Crosswhite is thrown headlong into the path of a killer conspiracy.</b> </p> <p>While investigating the hit-and-run death of a young boy, Seattle homicide detective Tracy Crosswhite makes a startling discovery: the suspect is an active-duty serviceman at a local naval base. After a key piece of case evidence goes missing, he is cleared of charges in a military court. But Tracy knows she can't turn her back on this kind of injustice. </p> <p>When she uncovers the driver's ties to a rash of recent heroin overdoses in the city, she realizes that this isn't just a case of the military protecting its own. It runs much deeper than that, and the accused wasn't acting alone. For Tracy, it's all hitting very close to home. </p> <p>As Tracy moves closer to uncovering the truth behind this insidious conspiracy, she's putting herself in harm's way. And the only people she can rely on to make it out alive might be those she can no longer trust. </p>"; 
